package com.techlabs.test;

public class Oops_begin {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a = 10;
		Integer aobj = a; //Autoboxing by creating a wrapper and storing datatype in object
		
		int b = aobj; // Unboxing storing aboj value in b
		
		System.out.println(aobj);
		System.out.println(b);
	}

}
